import { useRouter } from 'next/router'
import milestones from '../../data/milestones'
import { ThemeProvider } from 'theme-ui';
import theme from '../../theme';
import SEO from '../../components/seo';
import Layout from '../../components/layout';
import Banner from '../../sections/banner';
import TeamSection from '../../sections/team-section';
import Section from '../../components/simple-section'


export default function Milestones(props){

    const router = useRouter()
    // @ts-ignore
    const id = parseInt(router.query.id)
    const milestone = milestones.filter((milestone) => milestone.id === id)[0]

    console.log(milestone)

    return (
        <ThemeProvider theme={theme}>
            <Layout>
                <SEO title={`Agromag - Milestone ${milestone.id}`} />
                <Banner />

                {milestone.sections.map((section,i) => (
                    <Section 
                        title={section.title}
                        subTitle = {section.subTitle}
                        content = {section.content}
                        key={i}
                        children = {section.children ? section.children : null}
                    />
                ))}


                <TeamSection />

            </Layout>
        </ThemeProvider>
    )
}
